import './App.css';
import Clock from './Clock';
import Weather from './Weather';

function App() {
  return (
    <div className="App">
      <main>
        <h1>Welcome To Ten Peaks Lookout!</h1>
      </main>
      <footer>
        <div className="WeatherAndTime">
          <Clock/>
          <Weather/>
        </div>
        <div className="InformationBox">
          Tip: Lorem Ipsum
        </div>
      </footer>
    </div>
  );
}

export default App;
